const Button = ({ isEven, label }) => (
  <button
    className={`tile ${
      isEven ? "bg-blue-200" : "bg-white"
    } flex items-center justify-center`}>
    {label && typeof label === "string" ? (
      <img src={label} alt="piece" />
    ) : (
      label
    )}
  </button>
)

export default Button
